import Link from "next/link";
import { Nav, NavLink, Navbar, NavbarBrand } from "react-bootstrap";

const Navigate = () => (
  <header>
    <Navbar bg="light" expand="lg">
      <Navbar.Brand>
        <img src="https://dt2sdf0db8zob.cloudfront.net/wp-content/uploads/2020/01/Best-Dog-Logos-and-How-to-Make-Your-Own-for-Free-image3.jpg" alt="" />{" "}
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Link href="/">
            <Nav.Link>Random Dogs</Nav.Link>{" "}
          </Link>
          <Link href="/Havanese">
            <Nav.Link>Havanese Dogs</Nav.Link>{" "}
          </Link>
          <Link href="/German">
            <Nav.Link>Germanshepherd Dogs</Nav.Link>{" "}
          </Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  </header>
);

export default Navigate;
